    axios({
        url:"https://apibyashu.herokuapp.com/api/cakeorders",
        method:"post",
        data:{},
        headers:{
          authtoken:localStorage.token
        }
    }).then((response)=>{
      console.log("order data",response.data.cakeorders)
      cakes=response.data.cakeorders
     console.log(cakes)


    },(error)=>{
        console.log(error)
    })
   },[])
    return(

       <div>
      {cakes?.length>0 && cakes.map((each,index)=>{ 
          return(
              <div>
                  {each.name}
              </div>
          )
      })}
       </div>
    )
}
